import "./DisplayTime.css";

const DisplayTime = ({ active, minutes, seconds, milliseconds }) => {
    return (
      <div className="default">
        {minutes}m 
        {seconds}s 
        {milliseconds}
      </div>
    );
  };

  export default DisplayTime;
